import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';


import { HomeComponent } from './home/home.component';
import { LoginComponent } from './login/login.component';
import { RegisterComponent } from './register/register.component';
import { DestinationsComponent } from './destinations/destinations.component';
import { TrekComponent } from './trek/trek.component';
import { CampingComponent } from './camping/camping.component';
import { NationalComponent } from './national/national.component';
import { InternationalComponent } from './international/international.component';

const routes: Routes = [
  {path:'',component:HomeComponent},
  {path:'login',component:LoginComponent},
  {path:'register',component:RegisterComponent},
  {path:'destinations',component:DestinationsComponent ,children: [ 
    {
      path:'trek',component:TrekComponent
    },
    {
      path:'camping',component:CampingComponent
    },
    {
      path:'national',component:NationalComponent
    },
    {
      path:'international',component:InternationalComponent
    },
  ]}
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
